<thead>
<tr>
<th style="text-align:center">核心模块名称</th>
<th style="text-align:left">描述</th>
</tr>
</thead>
<tbody>
<tr>
<td style="text-align:center">Spring IOC</td>
<td style="text-align:left">包含了最为基本的Ioc容器BeanFactory的接口和实现，也就是说，在这个Spring的核心包中，不仅定义了IOC容器的最基本的接口（BeanFactory），也提供了一系列这个接口的实现，如XmlBeanFactory就是一个最基本的BeanFactory（IOC容器）。</td>
</tr>
<tr>
<td style="text-align:center">Spring Aop</td>
